def my_func(input1: str):
    if len(input1) < 1 or len(input1) > 20:
        return ""

    words = input1.split(' ')
    processed_words = []

    for word in words:
        parts = word.split('-')
        for i in range(1, len(parts)):
            parts[i] = parts[i].capitalize()
        processed_words.append(''.join(parts))

    return ' '.join(processed_words)
